  \"2015-11-20T22:40:08.690099\",\n\t\"name\": \"human-use-index-future\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Human land uses may have major impacts
  on ecosystems, affecting biodiversity, habitat, air and water quality. The human
  use index (also known as U-index) is the percentage of human land use in an area,
  including agriculture, urban and suburban development, and mining. Low values indicate
  little disturbance of natural land cover. More information about these resources,
  including the variables used in this study, may be found here: https://edg.epa.gov/data/Public/ORD/NERL/ReVA/ReVA_Data.zip.\",\n\t\"license_title\":
